small = df.iloc[:, 1:4]
big = df.iloc[:,4:13]
scol = list(small.columns)
bcol = list(big.columns)

scan = []
bcan = []
Cancer = []

for i in range(0, len(small)):
    n = small.iloc[i]
    s = 0
    for j in scol:
        if n[j] == 1:
            s += 1

    if s == 0:
        scan.append(0)
    else:
        scan.append(1)

for i in range(0, len(big)):
    n = big.iloc[i]
    s = 0
    for j in bcol:
        if n[j] == 1:
            s += 1

    if s == 0:
        bcan.append(0)
    else:
        bcan.append(1)

assert(len(scan) == len(bcan))
for i in range(0,len(scan)):
    sum = scan[i] + bcan[i]
    Cancer.append(sum)

# 2: Non-small cancer 1: Small cancer 0: Non-cancer
df['Cancer'] = Cancer
df

